import '../css/SectionB.css';

const SectionB = () => {
    return (
        <div className='sectionb'>
            <div className='row'>
                <div className='col-6'>
                <video controls autoplay className='col-12'>
                 <source src="https://player.vimeo.com/external/638914554.hd.mp4?s=81b54b0804759c55f2fa55db7c39b7ea8cca0abc&profile_id=175" type="video/mp4"/>
                </video>
                </div>
                <div className='col-6'>
                   <p className='bheader'>For friendly faces</p>
                   <p className='content'>Selections of cherished skin careâ€”some for the novice with empty bathroom cabinets, others for the well-stocked expert. </p>
                   
                </div>
            </div> 
        </div>
    )
}

export default SectionB;
